Меня зовут Анастасия. Я именно тот дипломированный и опытный стилист на свадьбу, корпоратив, день рождения, выпускной вечер, который вам нужен. Уже более 15 лет я работаю в индустрии красоты, помогая женщинам полностью раскрыть все грани их очарования. Моя главная задача – творить, создавая эксклюзивные образы: смелые и экстравагантные, строгие и неприступные, нежные и романтичные. Такие, какие нравятся вам!
Я имеют огромный опыт работы в качестве свадебного стилиста, парикмахера, визажиста. Лучше доказательство моего профессионализма и мастерства – многочисленные награды, грамоты, дипломы конкурсов парикмахерского искусства, благодарственные письма. 
Мои достижения:
•   Диплом “ Procter & Gamble ” ( 2 место 2000 год );
•   Диплом “ VI Чемпионат на Кубок губернатора Московской области ” ( 3 место 2009 год ) в номинации " Свадебная прическа";
•   Диплом " XV юбилейный чемпионат России по парикмахерскому искусству декоративной косметики и маникюру ” в номинации " Свадебная прическа " ( участник соревнований, призёр 2009 года , общее командное I место Сборной Московской области );  
•  Благодарственное письмо за участие в мероприятиях в рамках ”Всемирного дня красоты” (г. Серпухов 2010 год);
•  Диплом " XVII чемпионат России по парикмахерскому искусству декоративной косметики и маникюру " ( участник соревнований, призер 2011 года, общее командное I место Сборной Московской области );
•  Грамота и Благодарность за участие в благотворительном арт-фестивале в поддержку детей инвалидов " Фабрика красоты " 2013 года;
Моя квалификация:
•  Диплом Академии парикмахерского искусства  " Долорес ” повышение квалификации " Стиль. Цвет. Форма " ( 12 мая 2007 год ), с присвоением квалификации " Парикмахер - модельер"
•  Сертификат, от компании " EUROPA HAIR STUDIO ", обучение на семинаре по работе с профессиональным оборудованием и материалом для наращивания волос ( 8 июня 2009 года );
•  Диплом " Центра развития парикмахерского искусства и творческого досуга ", семинар " Французский шик " ( 2012 год );
Моя гордость:
•  “ПОЧЁТНАЯ ГРАМОТА” от главы города Серпухова П. Н. Залесова: за добросовестный труд и высокий профессионализм в работе.
Мои услуги
Я предлагаю  самые разнообразные услуги стилиста на свадьбу и любые другие праздничные мероприятия. 
•  Все виды причесок, включая наращивание волос, прически с добавлением искусственных и натуральных локонов; 
•  Консультации по индивидуальному подбору оптимального варианта прически и макияжа; 
• Сопровождение невесты во время фотосессии, прогулки, банкета смена/коррекция макияжа. Также вы можете воспользоваться услугами нашего профессионального фотографа, который будет сопровождать вас во время всей свадебной церемонии и сделает для вас незабываемые фотографии – бесценную память на всю жизнь! 
•  Выезд стилиста на дом в удобное для вас время. 
Стилист на свадьбу
 или почему вам стоит обратиться ко мне?
• Если вам нужен свадебный стилист-визажист на дом в ваш торжественный день, не сомневайтесь, что я предлагаю профессиональные услуги по обоснованной цене. Ваш персональный стилист на свадьбу недорого и быстро поможет вам стать самой красивой в свой самый торжественный день, а наш фотограф запечатлит каждое мгновение вашего праздника!
• Я ответственно и творчески отношусь к своей работе. Вызвав свадебного стилиста визажиста на дом, вы можете быть уверены, что не будете ждать ни одной лишней минуты; 
• Я работаю только с профессиональной качественной гипоалергенной косметикой для лица и волос.
Обращайтесь, если вам нужен профессиональный стилист на дом в день вашего торжества или постоянный мастер, который будет заниматься не только созданием, но и поддержанием вашего имиджа в идеальном состоянии. Я действительно предлагаю услуги стилиста на свадьбу недорого на самом высоком уровне! Приходите и убедите
